import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App'; 
import './index.css';

const rootElement = document.getElementById('root');
if (rootElement) {
  createRoot(rootElement).render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
} else {
  console.error('No root element found!');
}
